import {Instagram} from './Instagram';
import {Twitter} from './Twitter';
import {LinkedIn} from './LinkedIn';
import {GitHub} from './GitHub';
import { motion } from 'framer-motion';

export default function SocialList({height, width, color}) {
    const variants = {
        whileHover: { scale: 1.05 },
        whileTap: { scale: 0.95 },
      };

    const socialMediaIcons = [
        { IconComponent: Instagram },
        { IconComponent: Twitter },
        { IconComponent: LinkedIn },
        { IconComponent: GitHub },
      ];

    return (
        <>
            <ul className="flex justify-center">
                {/* <li> <Instagram height={height} width={width} color={color}/> </li>
                <li> <Twitter height={height} width={width} color={color}/> </li>
                <li> <LinkedIn height={height} width={width} color={color}/> </li>
                <li> <GitHub height={height} width={width} color={color}/></li> */}
                {socialMediaIcons.map((socialMediaIcon) => (
                    <motion.li>
                        <socialMediaIcon.IconComponent height={height} width={width} color={color} />
                    </motion.li>
                ))}
            </ul>
        </>
    );
}
